import axiosInstance from "../axiosInstance";
import { SIGN_IN } from "../component/constants";

export const signIn = async (data) => {
  console.log("axiosInstance", process.env.REACT_APP_BASE_APP_URL);
  const result = await axiosInstance
    .post(`http://localhost:8080/api/auth/${SIGN_IN}`, data)
    .then((response) => {
      return response;
    })
    .catch((error) => {
      return error;
    });

  return result;
};
